import "./App.css";
import tokiclogo from "../src/assets/tokic.jpg";

function App() {
  return (
    <div className="App">
        <div className='logotokic'>
          <img src={tokiclogo} alt="tokic" />
        </div>
    </div>
  );
}

export default App;
